ERM_finland.0.t:0 ""
ERM_finland.0.d:0 ""
ERM_finland.0.a:0 ""
ERM_finland.1.t:0 "Finland Requests Military Aid"
ERM_finland.1.d:0 "Mein Fuhrer, \n\nA personal letter from the President of Finland Risto Ryti has arrived on Herr Ribbentrop's desk today adressed to you. In this letter Ryti says that he will agree NOT to reach a separate peace with the Soviet Union without approval from Germany. \n\nHowever...in return for this Finland says that it will need to secure German military aid in order to stop the upcoming Soviet planned offensive. \N\NWhat should we do?"
ERM_finland.1.a:0 "Offer them the aid, we need Finland in the war"
ERM_finland.1.b:0 "The Wehrmacht needs that equipment more!"
ERM_finland.2.t:0 "Ryti-Ribbentrop Agreement"
ERM_finland.2.d:0 "President! \n\nThe German delegation headed by Herr Ribbentrop has presented our demands to Germany of military aid in order for us to stay in the war instead of seeking separate peace and the demands have been accepted. \n\nShould we still go along with this plan or perhaps it is time for peace instead?"
ERM_finland.2.a:0 "Accept the military aid we will need it regardless!"
ERM_finland.2.b:0 "We will decide our own fate separate from Germany's"
ERM_finland.2.c:0 "Begin seeking peace terms with Moscow immediately!"
ERM_finland.3.t:0 "Finland Seeks Peace Terms!"
ERM_finland.3.d:0 "Comrade Stalin, \n\nThe Finnish people have finally come to their senses and have decided to seek peace terms with us. Given the strategic situation although it would be nice to include them in our sphere of influence as a puppet, the Finnish front has already drained us of many much needed resources that would be better used against the Germans.\n\nIt would be wise to accept peace now and push with all our might against European Front and capture as much of Europe before the Allies can."
ERM_finland.3.a:0 "Accept the peace!"
ERM_finland.3.b:0 "There will be no peace for the Finns!"
ERM_finland.301.t:0 "Soviets Agree to Armistice!"
ERM_finland.301.d:0 "My President! \n\nThe Soviet Union has graciously accepted our terms for peace and the territories recovered in the continuation war will be transferred to the Soviets immediately. As unfortunate as it may be, we can count ourselves lucky that Finland will none-the-less remain a free nation and a part of the western world!"
ERM_finland.301.a:0 "Freedom is always the greatest victory!"
ERM_finland.302.t:0 "Soviets Disagree to Armistice!"
ERM_finland.302.d:0 "My President! \n\nThe barbaric Bolshevik state known as the Soviet Union has declined our terms for peace! They instead which to subjugate us under their communist yolk and would rather turn back time to imperialist Russia and have us be their subjects once more. \n\nDoubtless we shall fight on for the freedom of Finland is worth more than any one life or thousands of them!"
ERM_finland.302.a:0 "Such treachery..."
ERM_finland.4.t:0 "Risto Ryti Announces Plans for Resignation"
ERM_finland.4.d:0 "As in accordance to the Ryti-Ribbentrop Agreement, Finland under the leadership of Risto Ryti is not allowed to seek peace under his leadership but his successor will have free hand to break ties with Germany and start peace negotiations. \n\nSeeing this as right a time as any President Ryti has announced his intentions to resign in favor of C.G.E Mannerheim."
ERM_finland.4.a:0 "Ryiti shall resign!"
ERM_finland.4.b:0 "The war shall go on!"
ERM_finland.5.t:0 "Seek peace with Soviet Union?"
ERM_finland.5.d:0 "My President! \n\nNow that Risto Ryti has resigned in your favor you have a free hand to break ties with Germany and start peace negotiations with the Soviet Union. \n\nThe war has been lost, there is no more fight left in our people and we should preserve our liberty. However, if you wish to fight on the blood and terror that will happen will be on your hands!"
ERM_finland.5.a:0 "Seek peace terms immediately!"
ERM_finland.5.b:0 "We can still win!"
ERM_finland.6.t:0 "Lappland War Begins!"
